// App.js
import './App.css';
import OplaceWrapper from './components/OplaceWrapper';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="navbar">
          <h1>Ordr</h1>
          <p>Descripción de tu aplicación</p>
        </div>
      </header>
      <OplaceWrapper />
    </div>
  );
}

export default App;
